import { useState } from 'react';
import ChartBar from './ChartBar'
import '../../styles/Chart.css'

const Chart = (props) => {
    return <div className='chart'>
        {props.dataPoints.map((dataPoint) => <ChartBar value={dataPoint.value} key={dataPoint.id} label={dataPoint.label}></ChartBar>)}
    </div>
}
export default Chart;
